import axios from "axios";

export async function createUser(data, history) {
  await axios.get("http://localhost:3001/users", data).then(response => {
    console.log(response);
    if (response.status === 200) {
      history.push("/SignIn");
    }
    return {
      type: "CREATE_USERS",
      users: {}
    };
  });
}

export const getUsers = users => {
  return {
    type: "GET_USERS",
    users: users
  };
};
